import React from "react";
import './card.scss';
import { useNavigate } from "react-router-dom";
const Card=(props)=>{
    let navigate = useNavigate();
    return(
        <div>
         
  <div className="card">
    <img src="https://images.unsplash.com/photo-1438761681033-6461ffad8d80?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=870&q=80" alt="" />
    <h2 class="card__title">{props.title}</h2>
    <span className="card__description">{props.expiry}</span>
    <span class="card__description">{props.manufacture}</span>
    <span class="card__description">{props.price}</span>
    <button class="card__action" onClick={()=>navigate(`/home/${props.title}/update` , {state:{title:props.title,price:props.price,expiry:props.expiry,id:props.id,manufacture:props.manufacture}})}>
      <span class="mdi mdi-chevron-right">Add Review</span>
    </button>
  </div>
  
 
 
        </div>
    );
}
export default Card;
